pragma solidity  ^0.8.17;


contract EventTest {


    event addLiquidityEvent(
        address indexed sender,   //创建者
        uint256[]  nfts,   //nft总数
        uint256  tokenAmount, //token 总数
        uint256  liquidity   //lp token总数
    );

    event removeLiquidityEvent(
        address indexed sender, //移除者
        uint256  nftCount,   //nft 总数
        uint256  tokenAmount,   //token总数
        uint256  liquidity   //lp token总数
    );

    event depositToTokenEvent(
        address indexed sender,   // 存款者;
        uint256  indexed orderId,   //订单id
        uint256  indexed buyPricesSum,   //价格总和
        uint256[]  buyPrices   //价格明细
    );

    event editToTokenEvent(
        address indexed sender,   //编辑人
        uint256  indexed orderId,  //订单id
        uint256  indexed buyPricesSum,  //买价总和
        uint256[]  buyPrices   //买价明细
    );


    event depositToNFTEvent(
        address indexed sender,
        uint256  indexed orderId,
        uint256[]  indexed nfts,
        uint256[]  sellPrices
    );

    event editToNFTEvent(
        address indexed sender,
        uint256  indexed orderId,
        uint256[]  indexed nfts,
        uint256[]  sellPrices
    );

    event Swap(
        address indexed sender,
        uint256 tokenAmount,
        uint256 tokenId,
        uint256 tokenAmountOut,
        uint256 tokenIdOut
    );
